    "Process and transform text" : "Processer og transformer tekst",
    "This app brings a user interface to use the Nextcloud text processing feature.\n\nIt allows users to launch AI tasks, be notified when they finish and see the results.\nThe assistant also appears in others apps like Text to easily process parts of a document.\n\nMore details on the assistant OCS API and frontend integration possibilities in the\n[developer doc](https://github.com/nextcloud/assistant/raw/main/docs/developer)\n\n### How to use it\n\nA new right header menu entry appears. Once clicked, the assistant is displayed and you can select and task type and\nset the input you want to process.\n\nThe task might run immediately or be scheduled depending on the time estimation given by the AI provider.\nOnce a task is scheduled, it will run as a background job. When it is finished, you will receive a notification\nfrom which the results can be displayed.\n\nOther apps can integrate with the assistant. For example, Text will display an inline button besides every paragraph\nto directly select a task type to process this paragraph. Selecting a task this way will open the assistant with the task\nbeing pre-selected and the input text set.\n\nMore details and screenshots in the [user doc](https://github.com/nextcloud/assistant/raw/main/docs/user).\n\n## Features\n\nIn the assistant, the list of available tasks depends on the available providers installed via other apps.\nThis means you have complete freedom over which service/software will actually run your AI tasks.\n\n### Text processing providers\n\nSo far, the [Local Large language model](https://github.com/nextcloud/llm2#readme)\nand the [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai) apps\ninclude text processing providers to:\n* Summarize\n* Extract topics\n* Generate a headline\n* Get an answer from a free prompt\n* Reformulate (OpenAi/LocalAi only)\n* Context writer: Generate text with a specified style. The style can be described or provided via an example text.\n\n### Text to image (Image generation)\n\nKnown providers:\n* [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai)\n* [Text2Image Stable Diffusion](https://apps.nextcloud.com/apps/text2image_stablediffusion)\n\n### Speech to text (Audio transcription)\n\nKnown providers:\n* [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai)\n* [Local Whisper Speech-To-Text](https://apps.nextcloud.com/apps/stt_whisper)\n\nMore details on how to set this up in the [admin docs](https://docs.nextcloud.com/server/latest/admin_manual/ai/index.html)" : "Denne app leverer et brugerinterface til at anvende Nextcloud tekstprocesseringsfunktionen.\n\nDen giver brugere mulighed for at starte AI opgaver, blive underrettet når de slutter og se resultaterne.\nAssistenten vises også i andre apps såsom Tekst, for let at processere dele af et dokument.\n\nFlere detaljer om assistent OCS API og frontend integrationsmuligheder i\n[udvikler dok](https://github.com/nextcloud/assistant/raw/main/docs/developer)\n\n### Hvordan anvendes den\n\nEn ny indførsel i højre headermenu fremkommer. Når der klikkes på den, så vises assistenten og du kan vælge opgavetype og\nangive det input som du ønsker at processere.\n\nOpgaven kan køres straks eller kan planlægges afhængigt af tidsestimatet der gives af AI leverandøren.\nNår opgaven er planlagt, så vil den køres som et baggrundsjob. Når den afsluttes, så vil du modtage en notifikation i hvilken du også vil kunne se resultaterne.\n\nAndre apps kan integrere med assistenten. For eksempel, Tekst vil vise en indlejret knap ved siden af hver sætning\nfor direkte at vælge opgavetype der skal processerer netop denne sætning. Ved at vælge en opgave på den måde, så åbnes assistenten med opgaven forvalgt og inputteksten sat.\nFlere detaljer og screenshots i [bruger dok](https://github.com/nextcloud/assistant/raw/main/docs/user).\n\n## Funktioner\n\nI assistenten afhænger listen af tilgængelige opgaver af de tilgængelige leverandører der er installeret via andre apps.\nDet betyder at du har komplet frihed til at vælge hvilke service/software som rent faktisk vil køre dine AI opgaver.\n\n### Tekst processeringsleverandører\n\nLige nu, inkluderer [Local Large language model](https://github.com/nextcloud/llm2#readme)\nand the [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai) apps\ntekst processeringsleverandører til at:\n* Lave sammendrag\n* Udtrække emner\n* Generere overskrifter\n* Få et svar fra en åben prompt\n* Reformulere (kun OpenAi/LocalAi)\n* Kontekstskribent: Generer tekst med en angivet stil. Stilen kan beskrives eller leveres via en eksempeltekst.\n\n### Tekst til billede (billedgenerering)\n\nKendte leverandører:\n* [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai)\n* [Text2Image Stable Diffusion](https://apps.nextcloud.com/apps/text2image_stablediffusion)\n\n### Tale til tekst (Lydtransskribering)\n\nKendte leverandører:\n* [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai)\n* [Local Whisper Speech-To-Text](https://apps.nextcloud.com/apps/stt_whisper)\n\nFlere detaljer om hvordan du opsætter dette i [admin dok](https://docs.nextcloud.com/server/latest/admin_manual/ai/index.html)",
